export async function fetchTodayCount() {
  try {
    const res = await fetch('https://script.google.com/macros/s/AKfycbxGOGGJ1xCS0K_Qm7K7EHJK-XefCNzv3373Sr63T-IeH6-uca1_rL05plem95w0IUpkng/exec');
    const data = await res.json();
    return Array.isArray(data) ? data.length : 0;
  } catch (e) {
    return 0;
  }
}
